sys_variable_value.value:
(function execute(inputs, outputs) {
    try {
        var response = JSON.parse(inputs.response_body);
        if (inputs.status_code == "200") {
            outputs.status = "Success";
            outputs.spreadsheet_id = response["spreadsheetId"];
            outputs.title = response["properties"]["title"];
            outputs.spreadsheet_url = response["spreadsheetUrl"];
            if ('sheets' in response) {
                outputs.sheets = [];
                for (var i = 0; i < response["sheets"].length; i++) {
                    var sheet = {
                        sheetId: response["sheets"][i]["properties"]["sheetId"],
                        title: response["sheets"][i]["properties"]["title"],
                        index: response["sheets"][i]["properties"]["index"],
                        hidden: response["sheets"][i]["properties"]["hidden"]
                    };
                    outputs.sheets.push(sheet);
                }
            }
        } else {
            outputs.status = "Error";
            outputs.error_message = new global.GoogleSheetsErrorHandlerGlobal().commonErrors(response);
        }
    } catch (e) {
        outputs.status = "Error";
        outputs.error_message = new global.GoogleSheetsErrorHandlerGlobal().commonErrors(inputs.response_body);
    }
})(inputs, outputs);

